import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import '../Login/Login.css';




function Login() {
    return (
      <>

   <div style={styles.container}>
            <h1 style={styles.title}>Fundo</h1>
            <h2 style={styles.subtitle}>Sign in</h2>
            <p style={styles.description}>Use your Fundo Account</p>
            <form onSubmit={handleSubmit} style={styles.form}>
                <input 
                    type="text" 
                    placeholder="Email or phone*" 
                    value={email} 
                    onChange={(e) => setEmail(e.target.value)} 
                    style={styles.input} 
                    required 
                />
                <input 
                    type="password" 
                    placeholder="Password*" 
                    value={password} 
                    onChange={(e) => setPassword(e.target.value)} 
                    style={styles.input} 
                    required 
                />
                <button type="submit" style={styles.button}>Login</button>
                <div style={styles.links}>
                    <a href="#" style={styles.link}>Forgot password</a>
                    <span style={styles.link}> | </span>
                    <a href="#" style={styles.link}>Create account</a>
                </div>
            </form>
            <div style={styles.footer}>
                <select style={styles.select}>
                    <option>English (United States)</option>
                    {/* Add more languages as needed */}
                </select>
                <span style={styles.link}>Help</span>
                <span style={styles.link}>Privacy</span>
                <span style={styles.link}>Terms</span>
            </div>
        </div>
        {/* <TextField id="outlined-basic" label="Outlined" variant="outlined" /> */}

        {/* <Button variant="text">Text</Button> */}
      </> 
    );
  }

  export default Login;
